  [],\n\t\"revision_timestamp\": \"2015-09-27T02:24:26.701854\",\n\t\"name\": \"sensitivity-of-coastal-environments-and-wildlife-to-spilled-oil-florida-panhandle-fish-fish-pol\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for marine, estuarine, anadromous, and brackish/freshwater fish species
  for the Florida Panhandle. Vector polygons in this data set represent fish distribution,
  concentration areas, nursery areas, and spawning areas. Species-specific abundance,
  seasonality, status, life history, and source information are stored in relational
  data tables (described below) designed to be used in conjunction with this spatial
  data layer. This data set comprises a portion of the ESI data for the Florida Panhandle.
  ESI data characterize the marine and coastal environments and wildlife by their
  sensitivity to spilled oil. The ESI data include information for three main components:
  shoreline habitats, sensitive biological resources, and human-use resources.\",\n\t\"license_title\":
